-
I think most of us are familiar with the famous sketch by Monty Python, where we see John Cleese bring a dead parrot back to the pet store. "Well look, my lad, I know a dead parrot when I see one and I am looking at one right now. [...] This parrot wouldn't move if you put four thousand volts through it. It's bloody demised, it's passed on. This parrot is no more. It has ceased to be. It's expired and gone to see its maker. This is a late parrot. It's a stiff, bereft of life, it rests in peace, if you hadn't nailed it to the perch it would be pushing up the daisies. It's run down the curtain and joined the choir invisible. This is an ex-parrot!"
-
John Reardon's sculpture is presumably a homage to this sketch, although he chose a sulphur-crested cockatoo rather than a macaw.
