Autore: Calamide o bottega di Calamide
Data: 480-470 a.C. circa
Tecnica: Scultura in bronzo
Luogo: Museo archeologico nazionale, Atene

Il Cronide  √® una statua bronzea che venne rinvenuta nei pressi di un relitto, probabilmente una nave romana, vicino Capo Artemisio, nell'odierna Eubea.
L'attribuzione √® incerta ma si √® cercato di accostarlo a uno dei grandi bronzisti greci dell'epoca, come Calamide.

La statua rappresenta una figura maschile, una divinit√†, intenta nel lancio di un oggetto, probabilmente un tridente o un fulmine. Non si √® certi, infatti, se si tratti di Poseidone o Zeus, entrambi figli di Crono, da cui il nome della statua "Cronide").

Lo scultore voleva imprimere dinamismo alla figura attraverso l'apertura delle gambe e l'effetto a chiasmo, creato dal movimento degli arti superiori e inferiori. 
